const Home = () => {

    let likes = 0;
    let dislikes = 0;

    const handleClickLikes = (count, e) => {
        console.log('liked');
    }
    
    const handleClickDis = (name, e) => {
        console.log('liked by' + name, e.detail);
    }

    return ( 
        <div className="home">
            <h2>HomePage</h2>
            <p>{ likes }</p>
            <p>{ dislikes }</p>
            <button onClick={handleClickLikes}>Like</button>
            <button onClick={(e) => handleClickDis(1, e)}>Dislike</button>

        </div>
     );
}
 
export default Home;
